INSERT INTO `reports` (`id`, `name`, `description`, `type`, `created_at`, `updated_at`) VALUES
(1, 'Spider Man: Far from home', 'Bạn biết vì sao Avengers: Endgame không có after-credit không? Bởi vì ngay sau câu chuyện đó chính là sự ra mắt của Spider-Man: Far From Home đấy. Trở lại sau sự ra đi của người chú Tony – Iron Man, có vẻ như cậu bé Peter đã không còn đủ động lực, niềm tin để tiếp tục theo đuổi giấc mơ làm siêu anh hùng. Nhưng đời đâu phải lúc nào cũng như ý ta mong muốn! Nhất là khi ở ngoài kia, vẫn còn vô vàn kẻ xấu khác cần tiêu diệt. Trong chuyến du lịch đến châu Âu, Peter Parker và những người bạn của mình rơi vào rắc rối mới. Không những vậy, cậu còn được diện kiến Nick Fury. Liệu thử thách mới của Spider-Man sẽ khó khăn đến mức độ nào? Dù \"gan to\" cúp điện thoại của Nick Fury Peter vẫn phải hợp tác cùng ông để tiếp tục hành trình bảo vệ thế giới của chú Tony. Bên cạnh Nick Fury, Spider-Man: Far From Home còn có sự xuất hiện của một gương mặt mới là Mysterio. Liệu đây sẽ là nhân vật phản diện hay chính diện? ', 'Action', '2019-07-16 17:00:00', NULL),
(2, 'The Lion King', 'Một trong những bộ phim hoạt hình nổi tiếng nhất mọi thời đại - The Lion King nay ra mắt phiên bản live action. Là con của vị chúa tể rừng xanh Mufasa, chú sư tử Simba ra đời trong sự chào đón của muôn loài. Tuổi thơ đẹp đẽ bình yên của chú đột ngột kết thúc khi người cha vĩ đại bị hãm hại và qua đời. Lưu lạc khắp nơi, Simba bé nhỏ phải học cách sinh tồn một mình. May mắn thay, chú gặp được hai người bạn Timon và Pumbaa. ', 'Cartoon', '2019-07-16 17:00:00', NULL),
(3, 'MEN IN BLACK INTERNATIONAL', 'Những đặc vụ áo đen là người bảo vệ trái đất khỏi mối đe dọa từ các sinh vật ngoài hành tinh. Trong cuộc phiêu lưu mới này, nhiệm vụ của họ ngày càng trở nên nguy hiểm hơn khi phải đối đầu với một nội gián trong chính tổ chức của mình. Men In Black International là spin-off của siêu phẩm Men In Black nổi tiếng, do Chris Hemsworth, Tessa Thompson và Lian Neeson thủ vai chính. ', 'Action\r\n', '2019-07-16 17:00:00', NULL),
(4, 'MULAN', 'Là một cô gái hiếu thảo, Hoa Mộc Lan thay cha mình tòng quân để bảo vệ đất nước. Phim được Disney chuyển thể từ tác phẩm hoạt hình ăn khách năm 1998. Nữ diễn viên nổi tiếng Lưu Diệc Phi đảm nhận vai diễn Mộc Lan.', 'Action\r\n', '2019-07-16 17:00:00', NULL),
(5, 'TOY STORY 4', 'Woody vốn luôn rất tự tin và hài lòng về giá trị của bản thân: một nhân vật đồ chơi gắn liền với tuổi thơ của các cô bé cậu bé. Cho đến một ngày, sự xuất hiện của Forky và Bo Peep - những người bạn luôn ước mơ về một cuộc sống tự do và có quan niệm hoàn toàn trái ngược về đồ chơi đã khiến Woody phải suy nghĩ lại', 'Cartoon\r\n', '2019-07-16 17:00:00', NULL),
(6, 'THE ANGRY BIRDS MOVIE 2', 'Sau cuộc chiến kinh hoàng ở phần 1, bầy chim giận dữ và lũ heo xanh trở thành những kẻ thù không đội trời chung. Tuy nhiên, sự xuất hiện của một thế lực mới buộc chúng phải bỏ qua hiềm khích và đoàn kết lại', 'Cartoon\r\n', '2019-07-16 17:00:00', NULL),
(7, 'POKÉMON DETECTIVE PIKACHU', 'Là phiên bản live action của hoạt hình, truyện tranh và tựa game lừng danh thế giới - Pokémon: Detective Pikachu kể về thế giới nơi con người thu thập các Pokémon để chiến đấu với nhau, một cậu bé đã tình cờ nhặt được chú Pokémon tên Pikachu đang mong ước trở thành một thám tử', 'Cartoon\r\n', '2019-07-16 17:00:00', NULL);
